        static int NumTriplets(int[] nums1, int[] nums2)
        {
            var dict1 = new Dictionary<long, int>();
            var dict2 = new Dictionary<long, int>();
            var res = 0;
            for (int i = 0; i < nums1.Length; i++)
            {
                for (int j = i + 1; j < nums1.Length; j++)
                {
                    if (!dict1.ContainsKey((long)nums1[i] * nums1[j]))
                        dict1[(long)nums1[i] * nums1[j]] = 0;
                    dict1[(long)nums1[i] * nums1[j]]++;
                }
            }
            for (int i = 0; i < nums2.Length; i++)
            {
                for (int j = i + 1; j < nums2.Length; j++)
                {
                    if (!dict2.ContainsKey((long)nums2[i] * nums2[j]))
                        dict2[(long)nums2[i] * nums2[j]] = 0;
                    dict2[(long)nums2[i] * nums2[j]]++;
                }
            }
            foreach (var num in nums1)
            {
                if (dict2.ContainsKey((long)num * num))
                    res += dict2[(long)num * num];
            }
            foreach (var num in nums2)
            {
                if (dict1.ContainsKey((long)num * num))
                    res += dict1[(long)num * num];
            }
            return res;
        }
